import React from "react";
import "../styles/styles.css";
function Cart({ numberOfItems, totalCartPrice, cart }) {
  return (
    <>
      <h1>Shopping Cart (${numberOfItems} items)</h1>
      <h1>Total: $${totalCartPrice}</h1>
      <img
        className="cart-image"
        src={cartItem.imageSource}
        alt={cartItem.imageAltText}
      />
      <div className="cart-card">
        <h3 id="cart-roll-type">${cartItem.rollType}</h3>
        <h3 id="cart-glaze">Glazing: ${cartItem.rollGlaze}</h3>
        <h3 id="cart-pack">Pack Size: ${cartItem.rollPack}</h3>
        <h2 id="cart-pricing">$ ${cartItem.rollPrice}</h2>
      </div>
    </>
  );
}
export default Cart;
